# DFS


def DFS(row_index, column_index, matrix):
    if((row_index < 0 or row_index >= len(matrix)) or (column_index < 0 or column_index >= len(matrix[0])) or (matrix[row_index][column_index] != 1)):
        return
    matrix[row_index][column_index] = 2  # this show visited

    DFS((row_index-1), (column_index-1), matrix)  # top left
    DFS((row_index-1), (column_index), matrix)  # top
    DFS((row_index-1), (column_index+1), matrix)  # top right

    DFS((row_index), (column_index-1), matrix)  # left
    DFS((row_index), (column_index+1), matrix)  # right

    DFS((row_index+1), (column_index-1), matrix)  # button left
    DFS((row_index+1), (column_index), matrix)  # bottom
    DFS((row_index+1), (column_index+1), matrix)  # buttom right


def coundLand(matrix):
    count = 0
    m_Rows_size = len(matrix)
    m_Columns_size = len(matrix[0])
    for row_index in range(0, m_Rows_size):
        for column_index in range(0, m_Columns_size):
            if(matrix[row_index][column_index] == 1):
                DFS(row_index, column_index, matrix)
                count += 1
    return count


